El poema es un soneto escrito por Manuel del Palacio (1831-1906), poeta, periodista y satírico español del Romanticismo tardío que vivió durante el siglo XIX. Fue miembro de la Real Academia Española y conocido por sus sonetos y poesías satíricas.
